Game description: 
                 Monkey racing - help one of funny monkey racers win in dynamic races on amazing vehicles. Drive a sports car in this Android game. Unlock new cars, each with its unique characteristics and appearance. You need to win at all costs. Nudge your rivals off the road, shoot them with missiles, explode them with bombs, and so on. Defeat top bosses and receive different bonuses. Upgrade your car and win in new races.

Game features:


: Great graphics
: Good controls
: 80 different tracks
: Huge variety of cars
: 89 achievements
: Absorbing gameplay
